import React from "react";
import { Container, Row, Col, Card } from "react-bootstrap";

import TopNav from "../components/navbar/navbar";

export default function ShopAllMen() {
  return (
    <>
      <TopNav />
      <Container fluid>
        <Row>
          <Col>
            <Card></Card>
          </Col>
        </Row>
      </Container>
    </>
  );
}
